import React from 'react'

function Posts({posts,loading}) {
    if(loading){
        return <h2>Loading...</h2>
    }
    return (
        <ul>
            {posts.map(post=>(
                <li ket={post.id}>
                    {posts.product_name}
                </li>
            )
                )}
        </ul>
    )
}

export default Posts
